    width: 100px;
    height:100px;
    border-radius: 50%; 
    background-color: #999999;
`;

const Texts = styled.div`

`;

const Title = styled.h1`
    font-size:16px;
    font-weight: 500p;
    color: ${({theme}) => theme.text};
`;

const ChannelName = styled.h2`

`;

const Info = styled.span`
  color: ${({ theme }) => theme.textSoft};
`;


const VideoCard = () => {
    return (
        <Container>
            <Wrapper>
                <VideoPlayer>
                    <VideoImage />
                </VideoPlayer>
                <Details>
                    
                </Details>

            </Wrapper>
            <Recommendation>
                <h1>hello</h1>
            </Recommendation>
        </Container>
    )
}

export default VideoCard
